(1, 'Kami yang pertama di surabaya', 'Virto Office | Sewa Kantor Surabaya', '<p>Berdiri sejak tahun 2008. Merupakan persewaan ruang kantor yang terletak strategis di Timur Surabaya, VIRTO dilengkapi dengan sarana dan fasiilitas yang lengkap, seperti wifi dengan kecepatan tinggi hingga 50 Mbps, perabotan kantor standart berkualitas, ruang lobby yang nyaman serta fasilitas lain yang dapat menyesuaikan kebutuhan dan permintaan khusus Anda. Dengan beragam luas dan bentuk, VIRTO Sewa Kantor Surabaya merupakan solusi paling tepat untuk kebutuhan bisnis dan usaha Anda.<br>  <br> Dengan menjadi bagian dari VIRTO, Anda akan selalu menikmati kenyamanan fasilitas asisten pribadi yang akan siap mendukung aktivitas kerja anda, seperti menerima dan menjawab semua tamu, korespondensi dan telepon untuk Anda. Semua staf kami memiliki latar belakang professional, terlatih dan berpengalaman dalam memberikan layanan pelanggan berkualitas. .</p>\r\n					', 'Care', 'Professional', 'Affordable');

