(1, 'testi.png', 'Kualitas Audio Bagus. Wifi Stabil, cukup untuk keperluan browsing & cek email. Ruangan bersih dan nyaman. Toilet bersih. Pelayanan tim Virto sangat ramah, GREAT SERVICE !', 'Yuda', 'PT. Majulah Grup (Sewa Ruang Pertemuan untuk Recruitment)'),
(2, 'testi.png', 'Pertama kali menggunakan Coworking Room untuk Psikotes. Alhamdulillah ruangan nyaman dan acara berjalan lancar. Tim Virto sangat humble & helpfull sehingga kami merasa nyaman sekali seperti keluarga.', 'Rafika Pratiwi', 'PT. Parama Integra Indonesia (Member Virtual Office + Sewa Coworking Room)'),
(3, 'testi.png', 'Ruangan yang di sediakan cukup nyaman, para tamu juga menikmatinya.', 'Bu Enni Agency', 'Travel Umroh & Haji Syar''i (Member Ruang Permanen + Sewa Ruang Pertemuan untuk Manasik Umroh)'),
(4, 'testi.png', 'Mulai sound system, wifi, konsumsi, kenyamanan ruangan & fasilitas umum semuanya sangat baik. Pertahankan Prestasi, karena yang susah mempertahankan. Barakallahu', 'Dian Ranggajaya', 'Sekolah Muamalah Indonesia (Member Virtual & Sewa Ruang Pertemuan untuk Kelas Reguler)'),
(5, 'testi.png', '"PUAS BANGET, Keep it up. Tempat bersih, wifi kenceng, lengkap, WC juga bersih. The best pokoknya. Nanti kalau ke Surabaya, meeting disini lagi.', 'Mandy Claudia Chandra', 'PT. Synnex Metrodata Indonesia (Sewa Ruang Pertemuan untuk Meeting)'),
(6, 'testi.png', 'Ruang pertemuannya representatif & nyaman, juga bersih. Tamu saya juga puas dengan hasil pertemuannya. Thank you Virto!', 'Alex', 'Penyewa Personal (Pengguna ruang pertemuan untuk rapat & presentasi)'),
(7, 'testi.png', 'Tempatnya keren, ramah Ibu & anak.', 'Cholifah', 'PlasaMuslim.com (Peserta Virto Meet Up)');

